import React from 'react'
import { MDBBtn } from 'mdb-react-ui-kit';


const DesignButton = () => {
  return (
    <div className="Buttondes"> 
      <MDBBtn color='warning'>Getting to Registration Form</MDBBtn>
      <MDBBtn className='mx-2' color='info'></MDBBtn>
    </div>
  

    ) 
}
export default DesignButton;
